import React, { useState } from 'react';
import ResponsiveMenu from 'react-responsive-navbar';
import {FaBars,FaTimes} from 'react-icons/fa';
import 'bootstrap/dist/css/bootstrap.css';
import './Menu.scss';
import HamburgerMenu from 'react-hamburger-menu';



export function Menu () {

  const [open, setOpen] = useState(false);
  function handleClickOpen(){
    setOpen(true)
    if (!setOpen) {  
      console.log("son true")
}
}

    return (
        <header className="container-fluid container-header px-0 ">  
         <div className="row w-100 container-title mx-0 position-relative">
            <div className="col">
            <ResponsiveMenu
              menuOpenButton={<FaBars/>}
              menuCloseButton={<FaTimes/>}
              changeMenuOn="1000px"
              largeMenuClassName="large-menu-classname"
              smallMenuClassName="small-menu-classname position-absolute top-0 end-0"
              menu={
                 <ul className="menuList  position-absolute bottom-0 end-50">
                    <li className="item">
                      <a href="#">Descubre Ortegal</a>
                    </li>
                    <li className="item">
                      <a href="#">Habitaciones</a>
                    </li>
                    <li className="item">
                          <a href="#">Contacto</a>
                    </li>
                </ul>
              }
            />
            </div>

              <div className="col-8  container-title">
                <h2 className="title">Casa A Pasada</h2> 
                <p className="title-num">tlfn: 981 483 623</p>
              </div>
            </div>
            <HamburgerMenu
    isOpen={open}
    menuClicked={handleClickOpen}
    width={18}
    height={15}
    strokeWidth={1}
    rotate={0}
    color='black'
    borderRadius={0}
    animationDuration={0.5}
/>

        </header>
    )
}

export default Menu;
